import React from 'react'
import {View, Text, TouchableOpacity, StyleSheet} from 'react-native'

export function ButtonRecuperar (props) {

    const { text } = props

    return(
        <TouchableOpacity
            style = {{
                backgroundColor: '#AC6363',
                alignSelf: 'center',
                borderRadius: 5,
                width: '100%',
                marginVertical: 10,
                paddingVertical: 10,
            }}
            >
            <Text
                style = {{
                    color: '#fcfafa',
                    textAlign : 'center',
                    fontWeight: 'bold',
                }}
            >
                { text }
            </Text>
        </TouchableOpacity>
    )
}

export function ButtonCancelar (props) {

    const { onPress, text } = props

    return(
        <TouchableOpacity
            style = {{
                backgroundColor: '#AC6363',
                alignSelf: 'center',
                borderRadius: 5,
                width: '100%',
                marginVertical: 10,
                paddingVertical: 10,
            }}
            >
            <Text
                style = {{
                    color: '#fcfafa',
                    textAlign : 'center',
                    fontWeight: 'bold',
                }}
            >
                { text }
            </Text>
        </TouchableOpacity>
    )
}
